class Solution:
    # it's (m-1+n-1)C(m-1) 
    def __init__(self):
        self.mem = {}

    def factorial(self, num):
        if num < 2: return 1
        if num in self.mem: return self.mem[num]
        self.mem[num] = num * self.factorial(num-1)
        return self.mem[num]
        
    def uniquePaths(self, m: int, n: int) -> int:
        f = self.factorial
        m = m-1
        n = n-1
        top = f(m+n)
        bottom = f(m+n-m)*f(m)
        return top//bottom

class Solution:
    def uniquePaths(self, m: int, n: int) -> int:
        queue = [(0, 0)]
        ret = 0
        while queue:
            i, j = queue.pop()
            if i == m-1 and j == n-1: ret += 1
            else:
                if i < m:
                    queue.append((i+1, j))
                if j < n:
                    queue.append((i, j+1))
        return ret        


