class Solution:
    def uniquePaths(self, m: int, n: int) -> int:
        dp = [0]*m
        for i in range(n):
            cur_dp = [0]*m
            for j in range(m):
                if i == 0 or j == 0:
                    cur_dp[j] = 1
                else:
                    cur_dp[j] = cur_dp[j-1] + dp[j]
            dp = cur_dp
        return dp[m-1]


class Solution:
    def uniquePaths(self, m: int, n: int) -> int:
        dp = [[0]*m for _ in range(n)]
        for i in range(n):
            for j in range(m):
                if i == 0 or j == 0:
                    dp[i][j] = 1
                else:
                    dp[i][j] = dp[i-1][j] + dp[i][j-1]
        return dp[n-1][m-1]


class Solution:
    def __init__(self):
        self.ret = 0
        self.dp = {}
    
    def uniquePaths(self, m: int, n: int) -> int:
        return self.dfs(m-1,n-1, m, n)        
        
    def dfs(self, i, j, m, n):
        if (i, j) in self.dp: return self.dp[(i,j)] 
        if not i or not j: return 1
        self.dp[(i,j)] = self.dfs(i-1, j, m, n) + self.dfs(i, j-1, m, n)
        return self.dp[(i, j)]


class Solution:
    def __init__(self):
        self.ret = 0
    
    def uniquePaths(self, m: int, n: int) -> int:
        self.dfs(0,0, m, n)        
        return self.ret
        
    def dfs(self, i, j, m, n):
        if i == m-1 and j == n-1:
            self.ret += 1
        else:
            if i < m:
                self.dfs(i+1, j, m, n)
            if j < n:
                self.dfs(i, j+1, m, n)


