from collections import defaultdict, namedtuple

Node = namedtuple('Node', 'row col')

class Solution:
    def uniquePaths(self, row_count: int, col_count: int) -> int:
        queue = defaultdict(int)
        root = Node(row=0, col=0)
        target_node = Node(row=row_count-1, col=col_count-1)
        queue[root] = 1
         
        while queue and target_node not in queue:
            new_queue = defaultdict(int)
            for node in queue:
                for nei in adjacent(node, row_count, col_count):
                    new_queue[nei] += queue[node]
            queue = new_queue
        return queue[target_node]
    
def adjacent(node, row_count, col_count):
    if node.row + 1 < row_count:
        yield Node(row=node.row+1, col=node.col)
    if node.col + 1 < col_count:
        yield Node(row=node.row, col=node.col+1)
 




